import * as React from 'react';
import { AppBar, Box, Toolbar } from '@mui/material';
import Logo from '../assets/110pm_emblem_transparent.png';

export default function NavbarV2() {
  return (
    <Box flex={1}>
      <AppBar position="static">
        <Toolbar style={{
          height: '8rem',
          display: 'flex',
          flexDirection: 'row'
        }}>
          <img alt='' src={Logo}></img>

        </Toolbar>
      </AppBar>
    </Box>
  );
}
